import React from 'react';
import { Row, Col } from 'react-bootstrap';
import Product from '../components/Product';
import products from '../products';

const HomeScreen = () => {
    return (
        <>
            <div className="container text-center">
                <div className="row justify-content-center">
                    <div className="col-md-6">
                        <div className="info-box">
                            <h1></h1>
                            <div className="info-container">
                                <p>
                                    <strong>Asukoht:</strong> Vembu-Tembumaa kohvik, Pargi tee 1, Tartu
                                </p>
                                <p>
                                    <strong>Lahtioleku ajad:</strong> E-R 11:00 - 18:45, L-P suletud
                                </p>
                                <p>
                                    <strong>Üritused:</strong> Erinevad lõbusad üritused ja etteasted toimuvad regulaarselt, jälgige meie sotsiaalmeediat ja veebilehte, et olla kursis!
                                </p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>

            <Row>
                {products.map((product) => (
                    <Col key={product._id} sm={12} md={6} lg={4} xl={3}>
                        <Product product={product} />
                    </Col>
                ))}
            </Row>
        </>
    );
};

export default HomeScreen;
